import React, { Component } from "react";
import * as imageApi from "../apis/image";

export default class BillItem extends Component {
  componentDidMount() {
    console.log("props"+JSON.stringify(this.props));
  }
  render() {
    return (
      <tr>
        <td>
          <div className="d-flex px-2 py-1">
            <div>
              <img
                src={imageApi.image(this.props.bill.chitiethoadons.$values[0].imeiNavigation.masanphamNavigation.image)}
                className="avatar avatar-sm me-3"
                alt="xd"
              />
            </div>
            <div className="d-flex flex-column justify-content-center">
              <h6 className="mb-0 text-sm">{this.props.bill.chitiethoadons.$values[0].imeiNavigation.masanphamNavigation.tensanpham}</h6>
            </div>
          </div>  
        </td>
        <td>
          <div className="avatar-group mt-2">
          <h6 className="mb-0 text-sm">{this.props.bill.makhachhangNavigation.sodienthoai} </h6>
          </div>
        </td>
        <td className="align-middle text-center text-sm">
          <span className="text-xs font-weight-bold"> $14,000 </span>
        </td>
        <td className="align-middle">
          <div className="progress-wrapper w-75 mx-auto">
            <div className="progress-info">
              <div className="progress-percentage">
                <span className="text-xs font-weight-bold">60%</span>
              </div>
            </div>
            <div className="progress">
              <div
                className="progress-bar bg-gradient-info w-60"
                role="progressbar"
                aria-valuenow={60}
                aria-valuemin={0}
                aria-valuemax={100}
              />
            </div>
          </div>
        </td>
      </tr>
    );
  }
}
